import React from 'react'
import logo from './assets/images/logo.png';

function Navbar() {
    return (
        <>
        <nav className="nav-wrapper">
            <div className="nav-content">
                <img src={logo} alt="" className="logo" />
            </div>
        </nav>
        </>
    )
}

export default Navbar
